import Link from 'next/link'
import styled from 'styled-components'

const Nav = styled.div`
  display: flex;
  width: 100%;
  flex-direction: row;
  align-items: center;
`

const Header = () => (
  <Nav>
    <Link href="hell">
      <a>Hell</a>
    </Link>
  </Nav>
)

export default Header
